import React from "react";
import Tile from "../tile/Tile";

const TileList = ({ tiles }) => {

  return (
    <div>
      {data.map((tile, index) => {
        const { name, ...description} = tile
        return (
        <Tile key={index} name={name} description={description} />
      )})}
    </div>
  );
};

export default TileList;
